import logo from './logo.svg';
import './App.css';
import Login from './Login'
import { BrowserRouter, Routes, Route} from 'react-router-dom';
import Home from './Home';

function App() {
  return (
    <div className="App">
      <BrowserRouter>

        <Routes>
          <Route path="/" element={<Login />} />
          <Route path="/home" element={<Home />} />
        </Routes>

      </BrowserRouter>

    </div>
  );
}

export default App;
